        void Premuto(object sender, System.Windows.Forms.KeyPressEventArgs e)
        {
            switch (e.KeyChar.ToString().ToLower()[0])
            {
                case 'k':
                    this.Keys_Click(sender, e);
                    break;
                case 'n':
                    this.Keys2_Click(sender, e);
                    break;
                case 'f':
                    if (FineTurno.Enabled) { this.FineTurno_Click(sender, e); }
                    break;
                case '1':
                    if (B1.Visible && B1.Enabled) { this.B1_Click(sender, e); }
                    break;
                case '2':
